#Leetcode 2290
from heapq import heappush, heappop

def minimumObstacles(grid):
    m = len(grid)
    n = len(grid[0])
    min_obstacles = [ [float("inf")]*n for _ in range(m) ]
    heap = []
    buffer = [(0, 0, 0)]

    while buffer:
        x, y, obs = buffer[0]
        if min_obstacles[x][y] > obs:
            if x < m-1: buffer.append((x+1, y, obs+grid[x+1][y]))
            if y < n-1: buffer.append((x, y+1, obs+grid[x][y+1]))
            if x > 0: buffer.append((x-1, y, obs+grid[x-1][y]))
            if y > 0: buffer.append((x, y-1, obs+grid[x][y-1]))
            min_obstacles[x][y] = obs

        buffer.pop(0)

    return min_obstacles[m-1][n-1]


